import React from "react";
import Navbar from "./Navbar";
import logo from "../assets/logo.png";
import "./Header.css";

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <img src={logo} alt="Website Logo" />
      </div>
      <Navbar />
    </header>
  );
}

export default Header;
